namespace GeneratedCode.Services;

/// <summary>
/// A simple Hello World service demonstrating code generation
/// </summary>
public class HelloWorldService
{
    /// <summary>
    /// Returns a friendly greeting
    /// </summary>
    /// <param name="name">Optional name to greet</param>
    /// <returns>A greeting message</returns>
    public string SayHello(string? name = null)
    {
        if (string.IsNullOrWhiteSpace(name))
        {
            return "Hello, World!";
        }
        
        return $"Hello, {name}!";
    }

    /// <summary>
    /// Returns a greeting asynchronously
    /// </summary>
    public async Task<string> SayHelloAsync(string? name = null, CancellationToken cancellationToken = default)
    {
        // Simulate some async work
        await Task.Delay(10, cancellationToken);
        
        return SayHello(name);
    }
}
